import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormsModule } from '@angular/forms';
import { AuthService, RegisterCompanyRequest } from '../../services/auth.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-register',
  standalone: true,
  imports: [CommonModule, FormsModule],
  templateUrl: './register.component.html'
})
export class RegisterComponent {
  companyName = '';
  nit = '';
  contactEmail = '';
  adminEmail = '';
  adminPassword = '';
  adminFullName = '';
  errorMessage = '';
  successMessage = '';
  isLoading = false;

  constructor(
    private authService: AuthService,
    private router: Router
  ) {}

  onRegister() {
    if (!this.companyName || !this.nit || !this.contactEmail || 
        !this.adminEmail || !this.adminPassword || !this.adminFullName) {
      this.errorMessage = 'Please fill all fields';
      return;
    }

    this.isLoading = true;
    this.errorMessage = '';
    this.successMessage = '';

    const request: RegisterCompanyRequest = {
      companyName: this.companyName,
      nit: this.nit,
      contactEmail: this.contactEmail,
      adminEmail: this.adminEmail,
      adminPassword: this.adminPassword,
      adminFullName: this.adminFullName
    };

    this.authService.registerCompany(request).subscribe({
      next: () => {
        this.successMessage = 'Company registered successfully! Redirecting to login...';
        setTimeout(() => {
          this.router.navigate(['/login']);
        }, 2000);
      },
      error: (error) => {
        this.errorMessage = error.error?.error || 'Registration failed';
        this.isLoading = false;
      }
    });
  }

  goToLogin() {
    this.router.navigate(['/login']);
  }
}
<div class="container">
  <h1>Register Company</h1>

  <form (ngSubmit)="onRegister()">
    <h3>Company Information</h3>

    <div class="form-group">
      <label>Company Name:</label>
      <input type="text" [(ngModel)]="companyName" name="companyName" required />
    </div>

    <div class="form-group">
      <label>NIT:</label>
      <input type="text" [(ngModel)]="nit" name="nit" required />
    </div>

    <div class="form-group">
      <label>Contact Email:</label>
      <input type="email" [(ngModel)]="contactEmail" name="contactEmail" required />
    </div>

    <h3>Administrator Account</h3>

    <div class="form-group">
      <label>Admin Full Name:</label>
      <input type="text" [(ngModel)]="adminFullName" name="adminFullName" required />
    </div>

    <div class="form-group">
      <label>Admin Email:</label>
      <input type="email" [(ngModel)]="adminEmail" name="adminEmail" required />
    </div>

    <div class="form-group">
      <label>Admin Password:</label>
      <input type="password" [(ngModel)]="adminPassword" name="adminPassword" required />
    </div>

    <div *ngIf="errorMessage" class="error">{{ errorMessage }}</div>
    <div *ngIf="successMessage" class="success">{{ successMessage }}</div>

    <button type="submit" [disabled]="isLoading">
      {{ isLoading ? 'Registering...' : 'Register' }}
    </button>

    <button type="button" (click)="goToLogin()">
      Back to Login
    </button>
  </form>
</div>
